import React from "react";

const Movies = (props) => {
  const { moviesList, imagePath } = props;

  return (
    <div>
      {moviesList.map((m) => {
        return (
          <img key={m.id} src={imagePath + m.poster_path} alt={m.title}></img>
        );
      })}
    </div>
  );
};

export default Movies;
